Harga Tertera untuk 1 pasang baterai
Sudah termasuk juga wrap bening
________________________________
Pemasangan :
- Lepaskan wrap bawaan batrai;
- Simpan ring pelindung yang ada di kutub positif batrai, jangan sampai hilang;
- Pasang stiker dengan sempurna pada batrai;
- Masukkan wrap transparan/bening ke batrai dan ringnya di kutub positif;
- Panaskan wrap transparan/bening bisa menggunakan korek biasa atau hotgun.

*Wrap asli bawaan batrai bisa tanpa dilepas tp batrai akan semakin besar diameternya

Tidak ada garansi untuk kesalahan pemasangan ya gan.
Membeli = Setuju
Terima kasih
